import React from 'react'
import { useState, useEffect } from "react";

function Table(props) {

    const [node, setNode] = useState({ key: "", value: "" })

    const handleSubmitView = async (event) => {
        console.log(item, "item")
        const response = await axios.put(url, {
          categoryIdentifier: item.categoryIdentifier,
          categoryName: item.categoryName,
          categoryTax: parseInt(item.categoryTax)
        });
        console.log('Deleted successfully', response);
        setItem(prevItem => ({ ...prevItem, categoryName: '', categoryTax: 0 }));
        document.getElementById('edit_category_modal').close();
        fetchCategories();
      }

    const setItemAndDisplayPopup = (event) => {

        const popupName = event.currentTarget.getAttribute('popup-name')

        if (popupName === "view") {
            const itemString = event.currentTarget.getAttribute('data-item')
            const item = JSON.parse(itemString);
            setNode(prevItem => ({ ...prevItem, key: item.key, value: item.value }))

            console.log(node)
        }
    };


    const rows = props.data.map((item, index) => (

        <tr key={index} className='hover'>
            <th>{index + 1}</th>
            <td>{item.key}</td>
            <td>{item.value}</td>
            <td>
                <button type="button" class="btn btn-primary" onClick={setItemAndDisplayPopup} data-toggle="modal" data-item={JSON.stringify(item)} data-target="#exampleModalCenter" popup-name="view">
                    View or Edit
                </button>

            </td>

        </tr>

    ));

    return (
        <div><table class="table">
            <thead>
                <tr>
                    <th scope="col">#</th>
                    <th scope="col">Key</th>
                    <th scope="col">Value</th>
                    <th scope="col">Edit or View</th>
                </tr>
            </thead>
            <tbody>
                {rows}
            </tbody>
        </table>




            <div class="modal fade" id="exampleModalCenter" tabindex="-1" role="dialog" aria-labelledby="exampleModalCenterTitle" aria-hidden="true">
                <div class="modal-dialog modal-dialog-centered" role="document">
                    <div class="modal-content">
                        <div class="modal-header">
                            <h5 class="modal-title" id="exampleModalLongTitle">Modal title</h5>
                            <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                                <span aria-hidden="true">&times;</span>
                            </button>
                        </div>
                        <div class="modal-body">

                            <form>
                                <div class="form-group">
                                    <label for="key">Key</label>
                                    <input class="form-control" type="text" value={node?.key || ''} onChange={e => setNode(prevItem => ({ ...prevItem, key: e.target.value }))} placeholder="key" />
                                    <label for="key">Value</label>
                                    <input class="form-control" type="text" value={node?.value || ''} onChange={e => setNode(prevItem => ({ ...prevItem, value: e.target.value }))} placeholder="value" />

                                </div>
                            </form>

                        </div>
                        <div class="modal-footer">
                            <button type="button" class="btn btn-secondary" data-dismiss="modal">Close</button>
                            <button type="button" class="btn btn-primary">Save changes</button>
                        </div>
                    </div>
                </div>
            </div>


        </div>
    )
}

export default Table
